import React from 'react'

const ModelNode = ({type, value, selected}) => {
    return (
        <div className="model-node">
            <div>
                <p>{type}</p>
            </div>
            <p className="model-node-value">{value}</p>
        </div>
    )
};

export default ModelNode;
